import React, { Component, PropTypes } from 'react';
import { Button, Collapse, Accordion, Card, Form, Col  } from 'react-bootstrap';
import { connect } from 'react-redux'

class SideNavbar extends Component {

static propTypes = {
    accordionOpen: PropTypes.boolean.isRequired,
}

constructor(props) {
    super(props);
}

componentDidMount()
{
      
}

render() {

    return (
        <>
          {/* <Button
            onClick={() => this.setOpen(!this.state.open)}
            aria-controls="example-collapse-text"
            aria-expanded={this.state.open}
            size = "lg"
          >
            click
          </Button>
          <Collapse in={this.state.open}>
            <div id="example-collapse-text">
              Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus
              terry richardson ad squid. Nihil anim keffiyeh helvetica, craft beer
              labore wes anderson cred nesciunt sapiente ea proident.
            </div>
          </Collapse> */}

            <Accordion defaultActiveKey="0">
            <Card>
                <Card.Header>
                <Accordion.Toggle as={Button} variant="link"  eventKey="0">
                    Select Regions
                </Accordion.Toggle>
                </Card.Header>
                <Accordion.Collapse eventKey="0">
                <Card.Body>
                <Form>
                    <Form.Row>
                        <Form.Group as={Col} controlId="formGridGeography">
                        <Form.Label>Geography</Form.Label>
                        <Form.Control as="select">
                            <option>Choose...</option>
                            <option>...</option>
                        </Form.Control>
                        </Form.Group>
                    </Form.Row>
                    <Form.Row>
                        <Form.Group as={Col} controlId="formGridRegions">
                        <Form.Label>Regions</Form.Label>
                        <Form.Control as="select">
                            <option>Choose...</option>
                            <option>...</option>
                        </Form.Control>
                        </Form.Group>
                    </Form.Row>

                    <Form.Group id="formGridCheckbox">
                        <Form.Check type="checkbox" label="Check me out" />
                    </Form.Group>

                <Button variant="primary" type="submit">
                    Submit
                </Button>
                </Form>
                </Card.Body>
                </Accordion.Collapse>
            </Card>
            <Card/>
            </Accordion>
        </>
    );
    
}
  
}

const mapStateToProps = state => ({
    accordionOpen: state.accordionOpen
  })
  
  const mapDispatchToProps = dispatch => ({
    // toggleTodo: id => dispatch(toggleTodo(id))
  })
  
export default connect(
    mapStateToProps,
    mapDispatchToProps
)(SideNavbar)
